script: |
  super -f text -I q12560.spq | sort > q12560.out

inputs:
  - name: q12560.spq
    data: |
      SELECT DISTINCT + - col2, 29 AS col1 FROM tab2 (FORMAT parquet) cor0 WHERE NOT + col2 > col0 - + - 66 / + + 57;
  - name: tab2

outputs:
  - name: q12560.out
    data: |
      -23	29
      -40	29
      -58	29
